export default (function(a,b,c,d,e,f,g,h,i){return {data:{X1qVXXZBsl:{data:{id:224,attributes:{imdbId:"tt0112461",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjdlNzQxZGUtZTg5YS00ODg2LTkxMzctMDAyNmEwM2YyZjA4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"46%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:887,attributes:{title:c,plot:"Film adaptation of street tough Jim Carroll's epistle about his kaleidoscopic free fall into the harrowing world of drug addiction. As a member of a seemingly unbeatable high school basketball squad, Jim's life centers around the basketball court and the court becomes a metaphor for the world in his mind. A best friend who is dying of leukemia, a coach (\"Swifty\") who takes unacceptable liberties with the boys on his team, teenage sexual angst, and an unhealthy appetite for heroin -- all of these begin to encroach on young Jim's dream of becoming a basketball star. Soon, the dark streets of New York become a refuge from his mother's mounting concern for her son. He can't go home and his only escape from the reality of the streets is heroin for which he steals, robs and prostitutes himself. Only with the help of Reggie, an older neighborhood friend with whom Jim \"picked up a game\" now and then, is he able to begin the long journey back to sanity.",slug:"the-basketball-diaries"}}},books:{data:[{id:2646,attributes:{title:c,description:"The original classic story about growing up with drugs and sex and about learning to survive on the streets of New York--once again in print. An urban classic of coming of age. Copyright © Libri GmbH. All rights reserved.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9FlaAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1987-07-07",publisher:e,subtitle:"The Classic About Growing Up Hip on New York's Mean Streets"}},{id:2647,attributes:{title:c,description:f,thumbnail:g,authors:[b],firstBook:d,published:h,publisher:i,subtitle:a}},{id:2648,attributes:{title:"Basketball diaries",description:"Livre culte de l'underground new-yorkais, le Journal de Jim Carroll, paru au début des années 70, est à la fois le portrait d'une ville impitoyable, vue par les yeux fascinés d'un jeune sauvage urbain, et un manuel de révolte adolescente. Le joueur de basket arpente les trottoirs de New York City, racole, vole à l'étalage, arnaque, refourgue, se défonce, s'envoie en l'air et tire au panier des balles impeccables dans la même langue insolente. A la recherche, peut-être, d'une pureté hors d'atteinte. Ce qui, sans doute, inspira à Jack Kerouac la réflexion suivante : \" A treize ans, Jim Carroll écrit une prose plus intéressante que 98 % des romanciers contemporains. \" Jim Carroll est devenu, depuis la période dont le renom n'a cessé de croître dans l'underground new-yorkais. Il a enregistré plusieurs disques, dont le célèbre \" Catholic Boy \", au début des années 80.",thumbnail:a,authors:[b],firstBook:d,published:"1998-05-06",publisher:a,subtitle:a}},{id:2649,attributes:{title:c,description:f,thumbnail:g,authors:[b],firstBook:d,published:h,publisher:i,subtitle:a}},{id:2650,attributes:{title:"Void of Course",description:"Poems deal with love, longing, friendship, memory, time, and life in the city",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XllaAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1998-10-01",publisher:e,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940918967}}("","Jim Carroll","The Basketball Diaries",null,"Penguin Books","The original classic story about growing up with drugs and sex and about learning to survive on the streets of New York--once again in print. An urban classic of coming of age.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XcuwAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","1995-01-01","Penguin Group USA"))